import React from 'react';
import Layout from '../components/Layout';
import Hero from '../components/Hero';
import styled from 'styled-components';
import { COLORS } from '../styles/colors';

const Section = styled.section`
  margin: 3rem 0;
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const ServicesBlock = styled.div`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  margin-left: -20px;
`;

const BigHeading = styled.h2`
  color: #b3b3b3;
  font-size: clamp(1.4rem, 3vw, 2.2rem);
  font-weight: 600;
  margin-bottom: 0.4em;
  text-align: left;
  margin-left: 1px;
`;

const ServicesList = styled.ul`
  list-style: none;
  padding: 0;
  margin: 0 0 2.5rem 0;
  width: 100%;
  max-width: 480px;
`;

const ServiceButton = styled.button`
  background: none;
  border: none;
  padding: 0;
  margin: 0;
  width: 100%;
  text-align: left;
  cursor: pointer;
  display: flex;
  align-items: center;
  font-size: 1.7rem;
  font-weight: 500;
  line-height: 1.15;
  color: #222;
  outline: none;
`;

const Circle = styled.span`
  display: inline-block;
  width: 1em;
  height: 1em;
  border: 2px solid #222;
  border-radius: 50%;
  margin-right: 0.6em;
  background: ${({ filled }) => (filled ? '#222' : 'transparent')};
  transition: background 0.18s;
`;

const MoreButton = styled.button`
  background: #222;
  color: #fff;
  font-size: 1.25rem;
  font-weight: 600;
  border: none;
  border-radius: 8px;
  padding: 0.7rem 2.1rem;
  margin-top: 1.7rem;
  cursor: pointer;
  transition: background 0.18s;
  &:hover {
    background: #444;
  }
`;

const ClientsRow = styled.div`
  display: flex;
  gap: 2rem;
  flex-wrap: wrap;
  justify-content: center;
  align-items: center;
  margin: 2rem 0 3rem 0;
`;

const ClientLogo = styled.div`
  width: 120px;
  height: 48px;
  background: ${COLORS.offWhite};
  border-radius: 0.5rem;
  display: flex;
  align-items: center;
  justify-content: center;
  font-weight: 700;
  font-size: 1.1rem;
  color: #222;
`;

const WorkGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(260px, 1fr));
  gap: 2rem;
  margin: 2rem 0 3rem 0;
`;

const WorkCard = styled.div`
  background: ${COLORS.offWhite};
  border-radius: 1rem;
  min-height: 220px;
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  justify-content: flex-end;
  padding: 1.5rem;
  font-size: 1.1rem;
  font-weight: 500;
  color: #222;
`;

const WhatWeDoBlock = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  margin: 2.5rem 0 0 0;
`;

const WhatWeDoText = styled.p`
  font-size: 1.95rem;
  font-weight: 400;
  color: #222;
  text-align: center;
  max-width: 700px;
  margin: 0;
`;

const WhatWeDoLead = styled.span`
  color: #b3b3b3;
`;

const CardGrid = styled.div`
  display: flex;
  flex-direction: column;
  gap: 1.1rem;
  margin: 3.5rem auto 0 auto;
  max-width: 600px;
`;

const Card = styled.div`
  display: flex;
  align-items: center;
  background: ${({ bg }) => bg || COLORS.offWhite};
  border-radius: 10px;
  padding: 2.2rem 2.5rem;
  min-height: 220px;
  box-sizing: border-box;
  @media (max-width: 700px) {
    flex-direction: column;
    align-items: flex-start;
    padding: 1.2rem 1rem;
    min-height: 160px;
  }
`;

const CardImage = styled.div`
  width: 120px;
  height: 120px;
  background: #eee;
  border-radius: 8px;
  margin-right: 2.2rem;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 2.2rem;
  color: #bbb;
  @media (max-width: 700px) {
    margin-right: 0;
    margin-bottom: 1.1rem;
    width: 80px;
    height: 80px;
  }
`;

const CardContent = styled.div`
  flex: 1;
`;

const CardTitle = styled.h3`
  font-size: 2rem;
  font-weight: 600;
  margin: 0 0 0.7rem 0;
`;

const CardDesc = styled.p`
  font-size: 1.15rem;
  margin: 0;
`;

const Home = () => {
  const serviceNames = [
    'Custom AI',
    'Development',
    'Automation',
    'Production',
    'Design',
  ];
  const [hoveredIdx, setHoveredIdx] = React.useState(null);
  return (
    <>
      <Hero />
      <Layout>
        <Section>
          <ServicesBlock>
            <BigHeading>What we do</BigHeading>
            <ServicesList>
              {serviceNames.map((name, idx) => (
                <li key={name} style={{margin: '0.7rem 0'}}>
                  <ServiceButton
                    type="button"
                    tabIndex={0}
                    onMouseEnter={() => setHoveredIdx(idx)}
                    onMouseLeave={() => setHoveredIdx(null)}
                    onFocus={() => setHoveredIdx(idx)}
                    onBlur={() => setHoveredIdx(null)}
                  >
                    <Circle filled={hoveredIdx === idx} aria-hidden="true" />
                    {name}
                  </ServiceButton>
                </li>
              ))}
            </ServicesList>
          </ServicesBlock>
        </Section>
        <Section>
          {/* Testimonial removed as requested */}
        </Section>
        <Section>
          {/* Contact section removed as requested */}
        </Section>
        <WhatWeDoBlock>
          <WhatWeDoText>
            We <WhatWeDoLead>partner</WhatWeDoLead> with teams to launch new ideas, refine existing tools, and deliver better digital experiences.
          </WhatWeDoText>
        </WhatWeDoBlock>
        <CardGrid>
          <Card bg={COLORS.green}>
            <CardImage aria-label="Explore icon">[img]</CardImage>
            <CardContent>
              <CardTitle>Explore</CardTitle>
              <CardDesc>We create prototypes and strategies that lay the groundwork for future growth, helping you envision, analyse and act on product opportunities.</CardDesc>
            </CardContent>
          </Card>
          <Card bg="#F5F5F5">
            <CardImage aria-label="Build icon">[img]</CardImage>
            <CardContent>
              <CardTitle>Build</CardTitle>
            </CardContent>
          </Card>
          <Card bg="#F5F5F5">
            <CardImage aria-label="Elevate icon">[img]</CardImage>
            <CardContent>
              <CardTitle>Elevate</CardTitle>
            </CardContent>
          </Card>
        </CardGrid>
      </Layout>
    </>
  );
};

export default Home;
